import './Rank.scss';
import React from "react";
import ListView from './ListView';

const Box = (props) => {
  const box_name = props.name;
  var text="";
  if (box_name =="fact-box"){
    text="fact";
  } else if (box_name=="conv-box") {
    text="conv";
  } else {
    text="false";
  }

  return(
    <div>
      <div class={box_name}></div>

    </div>

  )
}

function Rank() {
  return (
    <div className="Rank">
      <h1>Rank Page</h1>
      <span class="row">
        <div class="fact-box"></div>
        fact
        <div class="conv-box"></div>
        conv
        <div class="false-box"></div>
        false
      </span>


      <ListView />
    </div>
  );
}

export default Rank;
